import React from "react";

export const Card = ({ title, text }) => {
  return (
    <div className="text-b">
      <h5>{title}</h5>
      <h3 className="p-2 text-balance">{text}</h3>
    </div>
  );
};

export const CardWithImage = ({ key, title, text, image, alt }) => {
  return (
    <div>
      <img src={image} alt={alt} className="mb-2" />
      <h5>{title}</h5>
      <span className="p-2">{text}</span>
    </div>
  );
};
